webpackJsonp([0xd110bad18cda],{1135:function(A,e){A.exports={data:{markdownRemark:{html:'<p>In this episode, I interview EJ LeBlanc, ID business owner, avid experimenter, and a real model for continuing learning as an instructional designer. We talk about the latest tool that EJ is adding to his toolkit, the Unity gaming engine. EJ talks about his choice of Unity as a tool worth learning and a little about the process he takes to learn it.</p>\n<iframe src="https://simplecast.com/e/44906?style=medium-light" width="100%" height="94px" frameborder="0" scrolling="no" seamless=""></iframe>\n<p>As always, shownotes are on the show page: <a href="https://dearinstructionaldesigner.simplecast.fm/">https://dearinstructionaldesigner.simplecast.fm/</a> Feel free to reach out to EJ to continue the conversation: <a href="https://twitter.com/ejleblanc">https://twitter.com/ejleblanc</a></p>',frontmatter:{date:"September 22, 2016",path:"/blog/dearid-interview-with-ej-leblanc",title:"#DearID: Interview with EJ LeBlanc",tags:["dear id","game development","game engine","Unity 3D"],categories:["Dear ID Show","GameDev"],featured:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:3,src:"/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-c6512.jpg",srcSet:"/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-c7d05.jpg 203w,\n/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-784f5.jpg 405w,\n/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-c6512.jpg 810w,\n/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-adada.jpg 1215w,\n/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-1c372.jpg 1500w",sizes:"(max-width: 810px) 100vw, 810px"}}}}}},pathContext:{}}}});
